export default (function(a,b,c,d,e){return {data:{ER038955T6:{data:{id:1083,attributes:{imdbId:"tt4477536",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTYxOTQ1MzI0Nl5BMl5BanBnXkFtZTgwMzgwMzIxNDM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"4.5\u002F10"},{Source:"Rotten Tomatoes",Value:"11%"},{Source:"Metacritic",Value:"31\u002F100"}],item_lang:{data:{id:1746,attributes:{title:d,plot:"Believing they have left behind shadowy figures from their past, newlyweds Christian and Ana fully embrace an inextricable connection and shared life of luxury. But just as she steps into her role as Mrs. Grey and he relaxes into an unfamiliar stability, new threats could jeopardize their happy ending before it even begins.",slug:"fifty-shades-freed"}}},books:{data:[{id:6221,attributes:{title:d,description:"THE OFFICIAL MOVIE TIE-IN EDITION. Based on volume three of the phenomenal #1 New York Times bestselling trilogy with more than 150 million copies sold worldwide. When unworldly student Anastasia Steele first encountered the driven and dazzling young entrepreneur Christian Grey it sparked a sensual affair that changed both of their lives irrevocably. Shocked, intrigued, and, ultimately, repelled by Christian's singular erotic tastes, Ana demands a deeper commitment. Determined to keep her, Christian agrees. Now, Ana and Christian have it all - love, passion, intimacy, wealth, and a world of possibilities for their future. But Ana knows that loving her Fifty Shades will not be easy, and that being together will pose challenges that neither of them would anticipate. Ana must somehow learn to share Christian's opulent lifestyle without sacrificing her own identity. And Christian must overcome his compulsion to control as he wrestles with the demons of a tormented past. Just when it seems that their strength together will eclipse any obstacle, misfortune, malice, and fate conspire to make Ana's deepest fears turn to reality.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=grORswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2018-01-16",publisher:e,subtitle:b}},{id:6222,attributes:{title:d,description:"Even though Christian and Anastasia are now a proper couple, they still have many obstacles to overcome, including Christian's past coming back to haunt Anastasia.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-3VxrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2012-01-01",publisher:"Lulu.com",subtitle:b}},{id:6223,attributes:{title:"Freed",description:"\"Relive the sensuality, the romance, and the drama of Fifty Shades Freed through the thoughts, reflections, and dreams of Christian Grey. E. L. James revisits the world of Fifty Shades with a deeper and darker take on the love story that has enthralled millions around the globe. You are cordially invited to the wedding of the decade, when Christian Grey will make Anastasia Steele his wife. But is he really husband material? His dad is unsure, his brother wants to organize one helluva bachelor party, and his fiancée won't vow to obey.... And marriage brings its own challenges. Their passion for each other burns hotter and deeper than ever, but Ana's defiant spirit continues to stir Christian's darkest fears and tests his need for control. As old rivalries and resentments endanger them both, one misjudgment threatens to tear them apart. Can Christian overcome the nightmares of his childhood and the torments of his youth and save himself? And once he's discovered the truth of his origins, can he find forgiveness and accept Ana's unconditional love? Can Christian finally be freed?\"--",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yy-azgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2022-01-05",publisher:"Fifty Shades of Gray",subtitle:b}},{id:6224,attributes:{title:"Grey",description:"In Christianâe(tm)s own words, and through his thoughts, reflections, and dreams, E L James offers a fresh perspective on the love story that has enthralled millions of readers around the world. CHRISTIAN GREY exercises control in all things; his world is neat, disciplined, and utterly empty âe\" until the day that Anastasia Steele falls into his office, in a tangle of shapely limbs and tumbling brown hair. He tries to forget her, but instead is swept up in a storm of emotion he cannot comprehend and cannot resist. Unlike any woman he has known before, shy, unworldly Ana seems to see right through him âe\" past the business prodigy and the penthouse lifestyle to Christianâe(tm)s cold, wounded heart. Will being with Ana dispel the horrors of his childhood that haunt Christian every night? Or will his dark sexual desires, his compulsion to control, and the self-loathing that fills his soul drive this girl away and destroy the fragile hope she offers him?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=27H-sgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2015-06-18",publisher:e,subtitle:"Fifty Shades of Grey As Told by Christian"}},{id:6225,attributes:{title:"Fifty Shades of Grey",description:"When Anastasia Steele, a young literature student, interviews wealthy young entrepreneur Christian Grey for her campus magazine, their initial meeting introduces Anastasia to an exciting new world that will change them both forever.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GbVdlAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2013-01-29",publisher:"Doubleday",subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940968290}}("E. L. James","",null,"Fifty Shades Freed","Arrow"))